import React from "react";
import CardProduct from "../components/CardProduct";
import image350cc from "../image/IMG_4214.JPG";

const imagelist = [image350cc, image350cc];

const Home = () => {
  return (
    <div>
      {imagelist.map((image) => (
        <CardProduct image={image} />
      ))}
    </div>
  );
};

export default Home;
